import "./App.css";

import Board from "./Components/Board";

function App() {
  return (
    <div className="App">
      <header className='navbar'>
        <div className='navbar__title navbar__item'>Tic-tac-toe</div>
        <div className='navbar__item'>Rules</div>

    </header>
      <Board />
    </div>
  );
}

export default App;
